import React from 'react';
import './Project.css';

const Project = () => {
  const projects = [
    { title: "Tourism Website", className: "row1item1", backgroundColor: "rgb(146, 213, 255)" },
    { title: "Jeopardy Quiz Game", className: "row1item2", backgroundColor: "rgb(255, 213, 146)" },
    { title: "Dragon Ball Game", className: "row2item1", backgroundColor: "rgb(255, 146, 213)" },
    { title: "Dictionary", className: "row2item2", backgroundColor: "rgb(213, 255, 146)" },
    { title: "To-Do List", className: "row3item1", backgroundColor: "rgb(146, 146, 255)" },
    { title: "Translator App", className: "row3item2", backgroundColor: "rgb(0, 146, 146)" },
    { title: "Explorez - Travel App", className: "row4item1", backgroundColor: "rgb(146, 255, 213)" },
    { title: "Weather Site", className: "row4item2", backgroundColor: "rgb(213, 146, 255)" },
    { title: "Youtube Clone", className: "row5item1", backgroundColor: "rgb(255, 213, 255)" },
    { title: "Pet Adoption App", className: "row5item2", backgroundColor: "rgb(213, 255, 213)" },
    { title: "Pokemon Card Generator", className: "row6item1", backgroundColor: "rgb(255, 255, 146)" },
  ];

  return (
    <div className="projpage-container">
      <h1 className="project-title">Projects</h1>

      <div className="projects-grid">
        {projects.map((project, index) => (
          <div className={`project-item ${project.className}`} key={index}>
            <h2>{project.title}</h2>
            <p>{project.description}</p>
          </div>
        ))}
      </div>
    </div>
  );
}

export default Project;
